const ADD_ARTICLE = 'ADD_ARTICLE';
const ADD_USER = 'ADD_USER';

const addUser = (name)=>({
    type: ADD_USER,
    payload: name
})

const addArticle = ({title,user})=>({
    type: ADD_ARTICLE,
    payload: {
        title,
        user
    }
})
console.log(addUser({title:'jjj',user}))

export { ADD_ARTICLE, ADD_USER, addArticle, addUser };
